import React, { useContext } from 'react';
import { CardContext } from '../context/CardContext';

const FinalPrice = () => {
  const price = useContext(CardContext);
  console.log(price);

  return (
    <div>
      <h4>FinalPrice</h4>
      {price.map((item) => {
        return <div>{item.FinalPrice}</div>;
      })}
    </div>
  );
};

export default FinalPrice;
